INSERT INTO `cms_video` VALUES ('19', '90', null, '12', '港囧', '电影天堂', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a target=\"_blank\" href=\"http://baike.baidu.com/subview/1096554/18949482.htm\">徐来</a><i>（徐峥）</i>是一个曾怀抱画家梦想，却沦为小商人的中年男，陪伴老婆<i>（赵薇饰）</i>及家人来到香港旅游，真正的目的，却是与成为香港新锐艺术家的大学初恋<i>（杜鹃饰）</i>偷偷会面。计划当天，徐来却被小舅子拉拉<i>（包贝尔饰）</i>一个怀揣纪录片梦想的二货青年给缠住了，拉拉阴魂不散，一路追随，竟还窥破姐夫的不轨企图。从旺角到中环，从弥顿道到铜锣湾，两人你追我赶，风波不断，美妙的香港之行，甜蜜的约会之旅，变成了一场惊心动魄的历险与逃亡', '/html/resource/video/images/1456802787179.jpg', '徐峥', '徐峥  赵薇  宝贝儿', '/html/lanhai/video/recommend//content_video/19.html', '\0', '2016-03-28 19:15:48', null, '2016-03-28 19:15:48', '3', null, '/html/resource/video/1457334899379.mp4');
