INSERT INTO `search_entity` VALUES ('1', 'cmsContent', 'topiecms', 'cms_content', 'id', 'title', 'url', 'origin', 'content_text', 'display_name', 'publish_date', null, null, null, null, null, 'select id from cms_content where is_html = 1 and publish_date >\'${dataimporter.last_index_time}\'', 'SELECT concat(c.id,\'_content\') as id,c.title,c.content_text,c.publish_date,c.origin,ch.display_name,c.url FROM cms_content c LEFT JOIN cms_channel ch ON c.channel_id=ch.id where c.is_html = 1', '0');
INSERT INTO `search_entity` VALUES ('2', 'cmsAudio', 'topiecms', 'cms_audio', 'id', 'name', 'url', 'singer', 'introduce', 'display_name', 'publish_date', null, null, null, null, null, 'select id from cms_audio where is_html = 1 and publish_date >\'${dataimporter.last_index_time}\'', 'SELECT concat(c.id,\'_audio\') as id,c.image_url,c.singer,c.publish_date,c.`name` ,c.url,c.introduce ,ch.display_name FROM cms_audio c LEFT JOIN cms_channel ch ON c.channel_id=ch.id where c.is_html = 1', '0');
INSERT INTO `search_entity` VALUES ('3', 'cmsNovel', 'topiecms', 'cms_novel', 'id', 'name', 'url', 'author', 'introduce', 'display_name', 'publish_date', null, null, null, null, null, 'select id from cms_audio where is_html = 1 and publish_date >\'${dataimporter.last_index_time}\'', 'SELECT c.name, concat(c.id,\'_novel\') as id,c.introduce,c.publish_date,c.image_url,c.url,ch.display_name FROM cms_novel c LEFT JOIN cms_channel ch ON c.channel_id=ch.id where c.is_html = 1', '0');
INSERT INTO `search_entity` VALUES ('4', 'cms_content_atta', 'url_file_ds', 'cms_attachment', 'id', 'title', 'attachment_url', 'origin', 'content_text', 'display_name', 'publish_date', null, null, null, null, null, '1', 'SELECT  concat(c.id,\'_\',ca.attachment_id,\'_content\') as id,c.publish_date,a.attachment_name,c.origin,c.url,c.title,a.attachment_url,a.id as aid\r\n				FROM cms_content_attachment ca\r\n				LEFT JOIN cms_content c ON c.id = ca.content_id\r\n				LEFT JOIN cms_attachment a ON a.id = ca.attachment_id\r\n				WHERE c.is_html = 1', '5');
INSERT INTO `search_entity` VALUES ('5', 'cms_content_atta_p', 'topiecms', 'cms_content', 'id', 'title', 'url', 'origin', 'content_text', 'display_name', 'publish_date', null, null, null, null, null, 'select id from cms_content where is_html = 1 and publish_date >\'${dataimporter.last_index_time}\'', 'SELECT  concat(c.id,\'_\',ca.attachment_id,\'_content\') as id,c.publish_date,a.attachment_name,c.origin,c.url,c.title,a.attachment_url,a.id as aid\r\n				FROM cms_content_attachment ca\r\n				LEFT JOIN cms_content c ON c.id = ca.content_id\r\n				LEFT JOIN cms_attachment a ON a.id = ca.attachment_id\r\n				WHERE c.is_html = 1', '0');
INSERT INTO `search_entity` VALUES ('6', 'tu_content', 'tumu_ds', 'cms_content', 'id', 'title', 'static_page_url', 'origin', 'CONTENT', 'channel_name', 'publish_time', null, null, null, null, null, 'select content_id from cms_content where is_static_page = 1 and publish_time >\'${dataimporter.last_index_time}\'', 'SELECT concat(c.content_id,\'_content\') as id,c.title,c.CONTENT,STR_TO_DATE(c.publish_time,\'%Y-%m-%d %H:%i:%s\') publish_time,c.origin,ch.channel_name,c.static_page_url \r\nFROM cms_content c \r\nLEFT JOIN cms_channel ch ON c.channel_id=ch.channel_id where c.is_static_page = 1', '0');
